import { BigNumberLike } from "@rarible/types";
import { EthCollectionTokenIdSignature } from "./EthCollectionTokenIdSignature";
export type CollectionTokenId = DefaultCollectionTokenId | EthCollectionTokenId;
export type DefaultCollectionTokenId = {
    "@type": "DEFAULT";
    tokenId: BigNumberLike;
};
export type EthCollectionTokenId = {
    "@type": "ETHEREUM";
    tokenId: BigNumberLike;
    signature: EthCollectionTokenIdSignature;
};
